import IconBox from "../Body/IconBox";
const Slides = () => {
  return (
    <div>
      <Carousel>
        <div>
          <IconBox />
        </div>
        <div>
        <IconBox />
        </div>
        <div>
        <img src="assets/1.jpeg" alt='p' />
          <p className="legend">Legend 3</p>
        </div>
      </Carousel>
    </div>
  );
};

export default Slides;
